import React, { Component } from "react";

export class home extends Component {
  render() {
    return (
      <div>
        <style>{"body { background-color: #322F40; }"}</style>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "10rem",
            fontSize: 32,
            color: "white",
          }}
        >
          Welcome to ReFinance!
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 23,
            color: "white",
          }}
        >
          A new way to finance...
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 10,
          }}
        >
          <a href="/login" class="btn btn-info">
            Login!
          </a>
          <a
            href="/signup"
            class="btn btn-info"
            style={{
              marginLeft: "1rem",
            }}
          >
            Sign Up!
          </a>
        </div>
      </div>
    );
  }
}

export default home;
